import React from 'react'
import './css/Description.css'
export default function Description(
    {padding, alignItems, titleSize, yearSize, descriptSize, languagesSize, title, year, descript, languages}) {
    return (
        <div id="description-wrapper" 
        style={{padding: padding, alignItems: 'center'}}>
        <h1 style={{fontSize : titleSize}} id="project-title">{title}</h1>
        <h1 style={{fontSize: yearSize}} id="year">{year}</h1>
        <p style={{fontSize: descriptSize}} id="descript">{descript}</p>
        <p style={{fontSize: languagesSize }} id="l">{languages}</p>
    </div>
    )
}
